export default function PageCadastrar(){
    return(
        <div className="container-cadastrar">
            <form action="/" method="get">
                <label for="nome">Nome:</label>
                <input name="nome" id="nome" type="text" placeholder="Nome da localização" />
                </form>
        </div>
    )
}
